collected = []
def events_collector(frame, event, arg):
    if frame.f_code.co_name == func.__name__:
        collected.append((event, frame.f_lineno, arg))
    return events_collector
import sys
sys.settrace(events_collector)
try:
    func()
except:
    import traceback
    traceback.print_exc()
finally:
    sys.settrace(None)
return collected
